Movie Info: Zanjeer (English: Shackles; titled Thoofan in Telugu) is a 2013 Indian action film directed by Apoorva Lakhia, shot simultaneously in Hindi and Telugu. The film marks the Bollywood debut of Tollywood actor Ram Charan in the lead role along with Priyanka Chopra. Prakash Raj joins the cast after success in Hindi films, like Wanted, Singham, and Dabangg 2.[2] It is a remake of the 1973 Hindi film of the same name. The Hindi version of the film is to be dubbed in Chinese as Chialo Kaxlaug. The Telugu version of the film was dubbed in Tamil and Malayalam. The Tamil version and Malayalam versions Date will later announce.Both the Telugu and Hindi versions released on September 6, 2013


